import { Component, OnInit } from '@angular/core';
import { MatSnackBar } from '@angular/material/snack-bar';
import { Alarma } from 'src/app/interfaces/alarma.interface';


@Component({
  selector: 'app-pagina-principal',
  templateUrl: './pagina-principal.component.html',
  styleUrls: ['./pagina-principal.component.css']
})
export class PaginaPrincipalComponent implements OnInit {

  momentoActual = new Date();
  listaAlarmas: Alarma[] = [];
  nombre = "";
  hora = "";

  constructor(private _snackBar: MatSnackBar) { }

  ngOnInit(): void {
    this.mueveReloj();
    if(localStorage.getItem('alarmas') != null){
      this.listaAlarmas = JSON.parse(localStorage.getItem('alarmas')!)
    }
  }


  mueveReloj() {
    this.momentoActual = new Date();
    this.compararAlarma();

    setTimeout(() => {
      this.mueveReloj()
    }, 1000)
  }

  crearAlarma() {

    if (this.nombre != "" && this.hora != "") {
      const nuevaAlarma = {
        nombre: this.nombre,
        hora: this.hora
      }
      this.listaAlarmas.push(nuevaAlarma)
      localStorage.setItem('alarmas', JSON.stringify(this.listaAlarmas))
      console.log(this.listaAlarmas);
      this.nombre = ""
      this.hora = ""
    }

  }

  borrarAlarma(i: number){
    this.listaAlarmas.splice(i,1)
    localStorage.setItem('alarmas', JSON.stringify(this.listaAlarmas))
    console.log('A');
    

  }

  compararAlarma() {
    let minutos = this.momentoActual.getMinutes()
    let hora = this.momentoActual.getHours()
    let horaAlarma = ""
    let minutosAlarma = ""
    let snackMostrada = false;

    if (this.momentoActual.getHours() >= 10) {
      horaAlarma = `${this.momentoActual.getHours()}`
    } else {
      horaAlarma = `0${this.momentoActual.getHours()}`
    }

    if (this.momentoActual.getMinutes() >= 10) {
      minutosAlarma = `${this.momentoActual.getMinutes()}`
    } else {
      minutosAlarma = `0${this.momentoActual.getMinutes()}`
    }
    // console.log(`${horaAlarma}:${minutosAlarma}`)
    let horaActual = `${horaAlarma}:${minutosAlarma}`



    if (this.listaAlarmas.length > 0) {

      for (let i = 0; i < this.listaAlarmas.length; i++) {
        if (horaActual == this.listaAlarmas[i].hora) {
          console.log("LAS ALARMAS COINCIDEN");
          this.openSnackBar(`La alarma ${this.listaAlarmas[i].nombre} estÃ¡ sonando`, 'Cancelar')
          this.listaAlarmas.splice(i, 1)
          this.beep()
        }
      }






    }


  }

  openSnackBar(message: string, action: string) {
    this._snackBar.open(message, action);
  }

  putTemaOscuro(){
    document.documentElement.style.setProperty('--color-bg', 'black');
    document.documentElement.style.setProperty('--color-boton','white');
    document.documentElement.style.setProperty('--color-boton-text','black');
    document.documentElement.style.setProperty('--color-fecha', 'white');
  }

  putTemaClaro(){
    document.documentElement.style.setProperty('--color-bg', '#D9D9D9');
    document.documentElement.style.setProperty('--color-boton','#0071DA');
    document.documentElement.style.setProperty('--color-boton-text','white');
    document.documentElement.style.setProperty('--color-fecha', 'black');
  }

  putTemaVerde(){
    document.documentElement.style.setProperty('--color-bg', 'green');
    document.documentElement.style.setProperty('--color-boton','white');
    document.documentElement.style.setProperty('--color-boton-text','black');
    document.documentElement.style.setProperty('--color-fecha', 'white');
  }

  beep() {
    var snd = new Audio("data:audio/mpeg;base64,")
    snd.play();
  }


}
